import { Col, Container, Row } from "react-bootstrap";
import "./Subpage.css";
import InfoHolder from "../../Component/SubPageLeftComponent/InfoHolder";
const SubPage = () => {
  return (
    <>
      <div className="subpage-wrapper">
        <Container>
          <Row>
            <Col xl={9}>
              <Row>
                <Col xl={3} className="info-holder">
                  <InfoHolder />
                </Col>
                <Col xl={6} className="decription">
                  4
                </Col>
              </Row>
            </Col>
            <Col xl={3}>2</Col>
          </Row>
        </Container>
      </div>
    </>
  );
};

export default SubPage;
